INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (24, 1, 0.0, 0.0, 0, 0.0, 102601, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24001, 10040, 1, "リン", "あたしだって\nやるときはやるよ！");
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (24, 1, 0.0, 0.0, 1, 0.0, 102601, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24002, 10040, 1, "リン", "ふぅ…\nこれであたしの仕事は\n終わりだね");
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (24, 1, 0.0, 0.0, 2, 0.0, 102601, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24003, 10040, 1, "リン", "終わった終わった\n一人でもなんとか\nなるもんだね");
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (24, 2, 0.0, 0.0, 3, 0.0, 102601, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24004, 10040, 2, "リン", "やったね！\nこれでようやく\nサボれるよ…");
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (24, 1, 0.0, 0.0, 4, 0.0, 102601, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24005, 10040, 1, "リン", "チーズが欲しいなら\nきちんと働いて\n買いに来なよ");
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (24, 2, 0.0, 0.0, 5, 0.0, 102601, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24006, 10040, 2, "リン", "あたしを敵に回した\n恐ろしさ\n思い知ったか！");
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (24, 2, 0.0, 0.0, 6, 0.0, 102601, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24007, 10040, 2, "リン", "あたしも意外と\nやるもんでしょ？");
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (24, 4, 0.0, 0.0, 7, 0.0, 102601, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24008, 10040, 4, "リン", "疲れた…\nねずみの逃げ足\n速すぎるよ…");
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (24, 4, 0.0, 0.0, 8, 0.0, 102601, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24009, 10040, 4, "リン", "このままじゃ\nまっひ～に\n叱られちゃうよ");
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (24, 4, 0.0, 0.0, 9, 0.0, 102601, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24010, 10040, 4, "リン", "まじめに\nやったんだけどな…\n悔しいな～");
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (24, 4, 0.0, 0.0, 10, 0.0, 102601, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24011, 10040, 4, "リン", "やられた…\nねずみって意外と\nてごわいね");
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (24, 4, 0.0, 0.0, 11, 0.0, 102601, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24012, 10040, 4, "リン", "おのれ～\nあたしのチーズを\n盗みやがって～！");
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (24, 4, 1.81, 0.0, 12, 0.0, 102601, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 24013, 10040, 1, "リン", "疲れた…\nけど、次こそは\n守り抜くよ…");
